import React from 'react'
import MdKeyboardArrowUp from 'react-icons/mdkeyboard'

function BackToTopButton () {
  const scrollToTop = () => window.scrollTo(0, 0)
  return (
    <div onClick={scrollToTop()}>
      <MdKeyboardArrowUp />
    </div>
  )
}
export default BackToTopButton
